  const [sensorsEvents, setSensorsEvents] = useState([]);

  const loadSensorEvents = async () => {
    const resp = await getSensorsEvent();
    console.log(resp.data.data);
    setSensorsEvents(resp.data.data);
  };

  useEffect(() => {
    loadSensorEvents();
  }, []);

  return (
    <div className="container d-flex justify-content-center">
      <div className="row align-items-start">
        <div className="row d-flex">
          <br />
          {sensorsEvents.map((sensorEvents) => {
            
            // return <SensorEventsItem sensorEvents={sensorEvents} key={sensorEvents._Id} loadSensorEvents={loadSensorEvents}/>;
          })}
        </div>
      </div>
    </div>
  );
};

export default SensorEvents;
